  \"2013-03-15T22:54:16.456401\",\n\t\"name\": \"west-virginia-faults\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a compilation of Fault
  features compiled by the West Virginia Geological and Economic Survey (WVGES), published
  as a Web feature service, a web map service, an ESRI service and as a downloadable
  document for the National Geothermal Data System. Each feature in an faults data
  set (row in this spreadsheet) should be characterized by a unique combination of
  name, URI, geologic history, slip, locatability and orientation properties, as well
  as being physically connected or inferred to be connected in the Earth. For mapped
  active faults, which are the scope of this scheme, the deformation style is assumed
  to be brittle (as opposed to ductile). \",\n\t\"license_title\": null,\n\t\"extras\":
